// ----------------------------------------------------------------------------
// File Path: src/pages/Auth/Auth.module.scss
// Description: SCSS styles for the auth page
// Author: Dan Levy
// Email: danlevy124@gmail.com
// Created Date: 1/3/2020
// ----------------------------------------------------------------------------

@import "../../root-styles/utilities.scss";

.auth {
    background-color: $primary-color;

    &Container {
        @include flex-container(
            $direction: column,
            $justify-content: center,
            $align-items: center,
            $wrap: nowrap
        );
        min-height: inherit;
        max-width: 1320px;
        padding: 40px 20px;

        @include media-query($breakpoint: $desktop-breakpoint) {
            flex-direction: row;
            justify-content: space-between;
        }

        @include media-query($breakpoint: $large-desktop-breakpoint) {
            margin: 0 auto;
        }
    }

    &Info {
        &Logo {
            display: block;
            width: 25px;
            margin: 0 auto 20px;

            @include media-query($breakpoint: $tablet-breakpoint) {
                width: 40px;
            }

            @include media-query($breakpoint: $desktop-breakpoint) {
                width: 50px;
                margin-bottom: 20px;
            }
        }

        &Heading {
            @include text($size: 1.25rem, $weight: 400, $color: $white-color, $line-height: null);
            text-align: center;
            margin-bottom: 20px;

            @include media-query($breakpoint: $tablet-breakpoint) {
                font-size: 1.56rem;
            }

            @include media-query($breakpoint: $desktop-breakpoint) {
                font-size: 2.2rem;
            }
        }

        &Subheading {
            @include text($size: 1rem, $weight: 500, $color: $white-color, $line-height: null);
            text-align: center;

            @include media-query($breakpoint: $tablet-breakpoint) {
                font-size: 1.56rem;
            }
        }
    }
}

